A very macro video for all to really understand how to fill an eyebrow , eyebrow filling and training is one of the hardest things in makeup application and it takes time to do it well, a brow should never look like a stamp or like your checking a box, the stronger harder brow is for stage, sometimes TV or for playing different characters on stage, an everyday eyebrow should look natural like hairs. Choosing the right color is the next challenge about eyebrows, too dark and too red are common mistakes. When training your brow be mindful of over tweezing/waxing,  I have lost a lot of brow hair because of it myself.

